import axios from 'axios';
var http = axios.create({
  baseURL: 'http://localhost:3003/'
});
http.interceptors.request.use(function (config) {
  return config;
}, function (err) {
  return Promise.reject(err);
});
http.interceptors.response.use(function (res) {
  return res.data;
}, function (err) {
  return Promise.reject(err);
});
export default http;
